import React, { Component, Fragment} from 'react';
import { Link } from "react-router-dom";
import '../UI/Navbar.css'
import logo from "../../assets/logo.png";
import NavMenu from './Nav/Nav-Menu';

class Navbar extends Component {
    render () {
        return ( 
            <Fragment>
                <div className="mx-auto flex flex-row p-4 justify-between max-w-screen-2xl">
                    <div className="font-display text-blue-primary font-medium text-lg">
                        Santa Barbara County District Attorney
                    </div>
                    <div className="ml-4 flex flex-row justify-center border-b-2 border-mustard">
                        <NavMenu title="Office"></NavMenu>
                        <NavMenu title="Prosecution"></NavMenu>
                        <NavMenu title="Investigation"></NavMenu>
                        <NavMenu title="Victim Services"></NavMenu>
                        <NavMenu title="FAQs"></NavMenu>
                        <NavMenu title="Contact"></NavMenu>
                    </div>
                </div>
            </Fragment>
        );
    }
}

export default Navbar;
